import React from "react";
import Playlist from "../pages/Playlist";

function Search (){
    let returened = () =>{
      alert("Heloo in search component")
    }
    return (
      <>
        {()=>{
          <Playlist fun={returened}/>
        }}
      </>
    )
}
export default Search
